import React, {useState} from "react";
import { VictoryPie } from "victory";

const data = [
    { x: "Business", y: 500 },
    { x: "Salary", y: 700 },
    { x: "Other", y: 300 }
];

const IncomePieChart = ({sortedTransactions}) => {
    const filteredIncomes = sortedTransactions.filter(transaction => transaction.valueOfTransaction > 0)
        .map(transaction => ({
            typeOfTransaction: transaction.typeOfTransaction,
            valueOfTransaction: transaction.valueOfTransaction
        }));

    return (
        <div>
            <VictoryPie
                data={filteredIncomes}
                colorScale={["#FFC300", "#FF5733", "#C70039"]}
                labelRadius={100}
                style={{ labels: { fontSize: 20, fill: "white" } }}
                animate={{ duration: 1000 }}
            />
        </div>
    );
};

export default IncomePieChart;
